webpackJsonp([0x6f591f5ebbe5],{6860:function(t,e){t.exports={data:{post:{html:'<p>When I first saw this graph of the CPU usage at my web host for the last month, I thought that WordPress was using less CPU than Movable Type had. </p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2004/06/1month-cpumins.png" alt="CPU activity for 1 month" /></p>\n<p>But then I remembered that I turned off a busy database cron job at the same time I switched blog software. That must explain it, since MT is busy in spurts, not continuously like in the graph.</p>',fields:{title:"Work Less Harder",date:"09 Jun 2004",url:"https://papascott.de/2004-06-09-work-less-harder/"}}},pathContext:{slug:"/2004-06-09-work-less-harder/",prev:{fields:{title:"Why'd You Cry-y-y, For The Guy-y-y, Say Goodby-y-ye",date:"09 Jun 2004",slug:"/2004-06-09-whyd-you-cry-y-y-for-the-guy-y-y-say-goodby-y-ye/"}},next:{fields:{title:"Gone With The Wind",date:"10 Jun 2004",slug:"/2004-06-10-gone-with-the-wind/"}}}}}});
